define(['jquery'],function($){'use strict';return function(requestUrl,ids){var deferred=$.Deferred();$.ajax({type:'GET',url:requestUrl+'?ids='+ids.join(','),data:{'form_key':window.FORM_KEY},dataType:'json',success:function(response){deferred.resolve(response.result);},error:function(response){deferred.reject(response.message);}});return deferred.promise();};});